script: |
  super -f text -I q9816.spq | sort > q9816.out

inputs:
  - name: q9816.spq
    data: |
      SELECT ALL - 70 FROM tab0 (FORMAT parquet) WHERE - + col0 > - 12 * + col2 * col0 + - col2 * ( - col0 ) * + col2 / + col0;
  - name: tab0

outputs:
  - name: q9816.out
    data: |
      -70
      -70
      -70
